<h1 mat-dialog-title>{{data.imageScanCompletedAt}}</h1>
<div mat-dialog-content>
    <div>
        <div class="form-group">
          <mat-form-field appearance="fill" class="input-modelo">
          <mat-label>imageScanCompletedAt</mat-label>
          <input id="imageScanCompletedAt"  readonly matInput [(ngModel)]="data.imageScanCompletedAt">
          </mat-form-field>
        </div>
        <div class="form-group" >
          <mat-form-field appearance="fill" class="input-modelo">
          <mat-label>vulnerabilitySourceUpdatedAt</mat-label>
          <input id="vulnerabilitySourceUpdatedAt"  readonly matInput [(ngModel)]="data.vulnerabilitySourceUpdatedAt">
          </mat-form-field>
        </div>

    </div>
</div>
